&quot;I Wonder&quot; is the second single from Kellie Pickler&amp;#039;s debut album, Small Town Girl. The song&amp;#039;s official release date is March 5, 2007.

I Wonder&amp;#039;s music video was shot on March 15, 2007 at the Ryman Auditorium in Nashville, Tennessee. The music video was released on March 31, 2007, on AOL. It starts off with Pickler getting off her tour bus and talking with fans as she enters at the famed showplace. After this, we see Pickler singing on a simple stage and, after, shows her walking to her dressing room, where she sees a little girl standing against the wall. She then walks out into the stage and sings. The song finishes and the video ends with Pickler seeing the little girl and smiling at her. On May 25 it topped the GAC Countdown and stayed on the top for five weeks. On July 19, it topped the CMT Top 20 Countdown, being the first Pickler video to do so. Pickler&amp;#039;s video also maintained its position on the CMT Top 20 Countdown as #1 for several weeks.



